import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";

const KeepData = (props) => {
    return (
        <>
        <ol>
            {props.value.map((values , index) => {
                return (
                    <div className = "container">
                    <div className = "row">
                    <div className = "col-3">
                    <h4 className = "text-success text-capitalize text-justify" >{values}</h4>
                    </div>
                    </div>
                    </div>
                )
            })}
            </ol>
        </>
    );
}
export default KeepData;
